/*******************CREATE TABLES IN DATABASE*************************/

-- Table 1: Product
CREATE TABLE Products (
	product_id NVARCHAR(10) PRIMARY KEY,
	product_name NVARCHAR(100) NOT NULL
)

--Table 2: Customers
CREATE TABLE Customers (
	customer_id NVARCHAR(10) PRIMARY KEY,
	region NVARCHAR(100) NOT NULL,
	country NVARCHAR(100) DEFAULT(N'Việt Nam')
)

--Table 3: Transportations
CREATE TABLE Transports (
	type_transport NVARCHAR(100) PRIMARY KEY,
	order_trs INT NOT NULL
)
DROP TABLE dbo.Transport
--Table 4: Priority

CREATE TABLE Priorities (
	priority_levels NVARCHAR(100) PRIMARY KEY,
	order_pri INT NOT NULL
)

-- Table 5: Sales

CREATE TABLE Sales (
	order_id int NOT NULL,
	customer_id NVARCHAR(10) REFERENCES Customers(customer_id),
	staff_name nvarchar(100) NOT NULL,
	order_date date NOT NULL,
	priority_levels NVARCHAR(100) REFERENCES Priorities(priority_levels),
	product_id NVARCHAR(10) REFERENCES Products(product_id),
	amount int NOT NULL,
	price float NOT NULL,
	discount float NOT NULL,
	transport_fee float NOT NULL,
	type_transport NVARCHAR(100) REFERENCES Transports(type_transport),
	package nvarchar(100) NOT NULL,
	transport_date date
)

